import React from "react"
import "./style.css"
import vector1 from "./Vector5.svg"
import vector2 from "./Vector6.svg"

export default function VectorSection() {
return(
<div class="vectors-wrapper">
    <img src={vector1} alt="No vector" class="extras-vector1" />
    <img src={vector2} alt="No vector" class="extras-vector2" />
</div>
)


}
